import axios from "axios";
import { useCallback, useEffect, useState } from "react";
import { Link, useNavigate } from "react-router-dom";

function Table() {
  const [data, setData] = useState([]);
  const [currentPage, setCurrentPage] = useState(1);
  const [itemsPerPage] = useState(10);

  const fetchData = useCallback(async () => {
    try {
      const response = await axios.get("/api/tickets");
      setData(response.data);
    } catch (error) {
      console.error(error);
    }
  }, []);

  useEffect(() => {
    fetchData();
  }, [fetchData]);

  const headers = {
    Lvl: "priorityIdById",
    "#": "id",
    Title: "title",
    Module: "ApplicationName",
    Type: "TicketTypeById",
    State: "statusById",
  };

  const indexOfLastItem = currentPage * itemsPerPage;
  const indexOfFirstItem = indexOfLastItem - itemsPerPage;
  const currentItems = data.slice(indexOfFirstItem, indexOfLastItem);

  // Change page
  const paginate = (pageNumber: number) => setCurrentPage(pageNumber);

  const navigate = useNavigate();

  const handleViewClick = (rowId: number) => {
    navigate(`/tickets/${rowId}`);
  };

  return (
    <div className="container">
      <div className="flex flex-col">
        <div className="text-end">
          <Link to="/tickets/newTicket">
            <button className="bg-blue-500 hover:bg-blue-700 text-white font-bold py-2 px-4 rounded">
              Create new ticket
            </button>
          </Link>
        </div>
        <div>
          <div className="inline-block min-w-full py-2">
            <div className="overflow-hidden">
              <table className="min-w-full border text-center text-sm font-light border-black">
                <thead className="border-b font-medium border-black">
                  <tr>
                    {Object.keys(headers).map((header, index) => (
                      <th
                        key={index}
                        scope="col"
                        // className={`py-4 border-black ${
                        //   index === Object.keys(headers).length - 1
                        //     ? ""
                        //     : "border-r"
                        // }`}
                      >
                        {header}
                      </th>
                    ))}
                  </tr>
                </thead>
                <tbody>
                  {currentItems.map((item, index) => (
                    <tr
                      key={index}
                      className="border-b border-black"
                      onClick={() => handleViewClick(item.id)}
                    >
                      <td
                        className={`whitespace-nowrap ${
                          index === Object.keys(item).length - 1
                            ? ""
                            : "border-r"
                        }  py-4 ${
                          index === 0 ? "font-medium border-black" : ""
                        }`}
                      >
                        {item.priorityIdById.title}
                      </td>
                      <td
                        className={`whitespace-nowrap ${
                          index === Object.keys(item).length - 1
                            ? ""
                            : "border-r"
                        }  py-4 ${
                          index === 0 ? "font-medium border-black" : ""
                        }`}
                      >
                        {item.id}
                      </td>
                      <td
                        // className={`whitespace-nowrap ${
                        //   index === Object.keys(item).length - 1
                        //     ? ""
                        //     : "border-r"
                        // }  py-4 ${
                        //   index === 0 ? "font-medium border-black" : ""
                        // }`}
                        style={{ maxWidth: "150px", overflow: "hidden" }}
                      >
                        {item.title}
                      </td>
                      <td
                        className={`whitespace-nowrap ${
                          index === Object.keys(item).length - 1
                            ? ""
                            : "border-r"
                        }  py-4 ${
                          index === 0 ? "font-medium border-black" : ""
                        }`}
                      >
                        {item.applicationName}
                      </td>
                      <td
                        className={`whitespace-nowrap ${
                          index === Object.keys(item).length - 1
                            ? ""
                            : "border-r"
                        } py-4 ${
                          index === 0 ? "font-medium border-black" : ""
                        }`}
                      >
                        {item.ticketTypeById.title}
                      </td>
                      <td
                        className={`whitespace-nowrap ${
                          index === Object.keys(item).length - 1
                            ? ""
                            : "border-r"
                        }  py-4 ${
                          index === 0 ? "font-medium border-black" : ""
                        }`}
                      >
                        {item.statusById.title}
                      </td>
                    </tr>
                  ))}
                </tbody>
              </table>
            </div>
          </div>
        </div>
        {/* Pagination */}
        <div className="flex justify-center mt-4">
          <ul className="flex items-center">
            {Array.from({ length: Math.ceil(data.length / itemsPerPage) }).map(
              (_, index) => (
                <li key={index}>
                  <button
                    onClick={() => paginate(index + 1)}
                    className={`px-3 py-1 rounded-md focus:outline-none ${
                      currentPage === index + 1
                        ? "bg-blue-500 text-white"
                        : "bg-gray-200 text-gray-700"
                    }`}
                  >
                    {index + 1}
                  </button>
                </li>
              )
            )}
          </ul>
        </div>
      </div>
    </div>
  );
}

export default Table;
